import React from 'react';
import LandingPage from './LandingPage';
import HousePosts from './HousePosts';

function Home({ isAuthenticated }) {
  return (
    <div>
      {isAuthenticated ? <HousePosts /> : <LandingPage />}
    </div>
  );
}

export default Home;
